import React from 'react'

const Footer = () => {

    const footeritems = [
        {id:1, link:'FAQ' , href :'https//www.google.com'},
    ]

    return (
        <div className='bg-black  mt-1 h-full'>
            <div className='mx-10 p-10 bg-cyan-500'>
                <p className='text-white px-10 text-xl'>Questions? Call 000-800-919-1694</p>
            </div>

            <div className='bg-red-500 flex '>
                {
                    footeritems.map(({id, link}) => {
                        return <>
                            <div >
                                <ul>
                                    <li></li>
                                </ul>
                            </div>
                        </>

                    })
                }

            </div>

            <div>

            </div>
        </div>
    )
}

export default Footer
